import styled from "styled-components"
import About from "./Career/About"


const CareerContainer = styled.div`
    width : 45rem;
    background-color : blue;
    padding : 20px;
`


function MyCareer(){
    return(
        <CareerContainer>
                <About />
        </CareerContainer>
    )
}

export default MyCareer
